B.RJ=new A.aL("This project Started out by reading 'I used to know that: General Science', where I re-learnt about e=mc\xb2, \nand how that was the formula to figure out how much energy was in an object.\n\nI then came up with idea usng the previous knowledge and the knowledge that fire converts stored energy into other forms of energy,\nI created a science experiment. This science experiment was to figure out how much energy would be released from a book if you burnt it.\n\n\nI theorized about how to calculate the answer and eventually came up with the formula Energy Released = (Mass before - Mass after)times the speed of light\xb2 / the time it took to burn. \n\nOnce I had the formula down it was time to test so I burnt a book with mass of 163grams.\n\n\nThis experiment was intended to figure out the stored energy released from a 163 gram book when on fire, we did this by using the equation ((Mb - Ma) x C\xb2) / T = ER in which we calculated that in total the fire released around 2.131487781892x1013 joules of stored energy from a 163-gram book in 34 minutes. \n\nThe major issue with this is that the experiment will vary on conditions like wind, heat, mass of the book, size and shape of the container, the time it took to burn. leading to varied outcomes and varied calculations. There is no real way to fix this issue since the variables needed to control this experiment are ever changing.\n\n\n",null,B.a3,null,null,null,null,null,null)
